import React from "react";
import TeamMember from './TeamMember';

function Team() {
    let info = [
        { id: 1, name: "Jon Snow",  position: "Kit Harington", phone: "0541412724", email: 'King@gmail.com', website: "ironThrone.com" },
        { id: 2, name: "Cersei Lannister",  position: "Lena Headey", phone: "0500000000", email: 'Queen@gmail.com', website: "ironThrone.com" },
        { id: 3, name: "Daenerys Targaryen",  position: "Emilia Clarke", phone: "0599999999", email: 'calisi@gmail.com', website: "ironThrone.com" },
        { id: 4, name: "Terrian Lannister",  position: "Peter Dinklage", phone: "0511111111", email: 'Hand@gmail.com', website: "ironThrone.com" },
        { id: 5, name: "Arya Stark",  position: "Maisie Williams", phone: "0000000000", website: "ironThrone.com" },
        { id: 6, name: "Sansa Stark",  position: "Sophie Turner", phone: "0000000000", email: 'north@gmail.com', website: "ironThrone.com" },
    ];
    const members = info.map(member => (
        <TeamMember
            key={member.id} // Unique key prop for each child
            name={member.name}
            img={member.img}
            position={member.position}
            phone={member.phone}
            email={member.email || 'N/A'} // Fallback for missing email
            website={member.website}
        />
    ));
    return (
        <div className="row">
            {members}
        </div>
    );
}
export default Team;
